import React,{useState} from 'react'
import Dice from './Dice'
import './RollDice.css'

function RollDice() {

  const [state, setState] = useState({
    dice1: "one",
    dice2: "three",
    rolling: false,
    totalScore:4
  })

  const { dice1, dice2, rolling, totalScore } = useState;

  return (
    <>
      <div className='roll-dice'>
        <div className='rolldice-container'>
          <Dice face="one" />
          <Dice face="three"/>
        </div>
      </div>
             
    </>
  )
}

export default RollDice
